'use strict';
import { registerLanguage } from '../_.contribution.js';
registerLanguage({
    id: 'msdax',
    extensions: ['.dax', '.msdax'],
    aliases: ['DAX', 'MSDAX'],
    loader: function () { return import('./msdax.js'); }
});
